        {/* Main Content Area */}
        <div className="flex-grow-1 d-flex justify-content-center align-items-center">
          <div>
            <h1>Iphone 13</h1>
            {/* ... rest of your content ... */}
          </div>
        </div>
      </div>
    </React.Fragment>
  );
}
